import Navbar from "./Navbar";
import Search from "./Search";

const Header = () => (
  <div className="container-fluid header">
    Header
    <Navbar/>
    <Search/>

    <style jsx>{`
      .header {
        background-color: rgb(255, 255, 255);
      }
      * {
        border: 5px solid red;
      }
    `}</style>
  </div>
);

export default Header;
